          "class": "Text",
          "base_class": "Block",
          "content": "Briefed to write and design an annotated bibliography for Ali's Research Methods. This project was designed in a custom web based tool. For a sneak peak of how this tool looks and behaves, [check this recording.](https://are.na/block/24747610)\n\nThe tool has ephemeral qualities of liveness and performance inscribed into it, leaving the marks of text boxes as they move that disappear over time— attempting to re frame graphic design as a performative practice. The arcs make shapes based on the proximity of text boxes to one another. Lines exist.",
          "content_html": "<p>Briefed to write and design an annotated bibliography for Ali's Research Methods. This project was designed in a custom web based tool. For a sneak peak of how this tool looks and behaves, <a href=\"https://are.na/block/24747610\" rel=\"nofollow noopener\">check this recording.</a></p>\n\n<p>The tool has ephemeral qualities of liveness and performance inscribed into it, leaving the marks of text boxes as they move that disappear over time— attempting to re frame graphic design as a performative practice. The arcs make shapes based on the proximity of text boxes to one another. Lines exist.</p>",
